function denoms(e){let n=[e];let t=Math.ceil(e/2);while(t>0){if(e%t===0)n.push(t);t--}return n}const commonDenominators=(...e)=>{const n=e.filter(e=>Number.isInteger(e)&&e>0);const t=Math.min(...n);if(t<2)return[1];if(!n.length)return n;const o=denoms(t).sort((e,n)=>e-n);if(n.length===1)return[...o];n.splice(1,n.length-1).map(e=>{let n=o.length-1;while(n>=0){if(e%o[n]!==0){o.splice(n,1)}n--}});return o};module.exports=commonDenominators;